import React from 'react'

const Navbar = () => {
  return (
    <div className='flex items-center justify-between p-8 z-[100] w-full absolute'>
        <h1 className='font-bold text-2xl text-gray-50'>Winko Wallet</h1>
        <div className='bg-black-1000'>
            <button className='pr-100 rounded bg-black text-white w-max h-max px-8 py-1'>Connnect</button>
        </div>

    </div>
  )
}

export default Navbar
